from io import BytesIO

import tensorflow as tf
from PIL import Image

from tensorflow.keras.applications.imagenet_utils import decode_predictions
import numpy as np


# https://towardsdatascience.com/image-classification-api-with-tensorflow-and-fastapi-fc85dc6d39e8
def load_model():
    model = tf.keras.applications.MobileNetV2(weights="imagenet")
    print("Model loaded")
    return model
model = load_model()

def predict(image: Image.Image):
    image = np.asarray(image.resize((224, 224)))[..., :3]
    image = np.expand_dims(image, 0)
    image = image / 127.5 - 1.0
    result = decode_predictions(model.predict(image), 2)[0]
    response = []
    for i, res in enumerate(result):
        resp = {}
        resp["class"] = res[1]
        resp["confidence"] = f"{res[2]*100:0.2f} %"
        response.append(resp)
    return response

def read_imagefile(file) -> Image.Image:
    image = Image.open(BytesIO(file))
    return image


def make_prediction(imageData):
    import base64
    dat = imageData.replace('%2F', '/')

    # https://stackoverflow.com/questions/49511753/python-byte-image-to-numpy-array-using-opencv
    image_bytes = base64.b64decode(dat)

    image = read_imagefile(image_bytes)
    prediction = predict(image)
    return prediction

